import React from 'react';
import Lottie from 'lottie-react';
import cardbg from '../assets/cardbg.json';

const CatCard = () => {
  return (
    <div className="relative">
      {/* Lottie animation as background */}
      <Lottie
        animationData={cardbg}
        style={{
          position: 'absolute',
          top: 0,
          left: 0,
          width: '100vw', // Full width of the viewport
          height: '100vh', // Full height of the viewport
          zIndex: -1, // Ensure the animation stays behind other content
        }}
      />
      {/* Content container */}
      <div className="bg-transparent rounded-lg shadow-lg p-6 ">
        <div className="grid grid-cols-3 gap-6 mx-16"> {/* Adjusted margin to make cards width shorter */}
          {/* 10 content sections */}
          {[...Array(10)].map((_, index) => (
            <div key={index} className="bg-white rounded-lg shadow p-8 flex flex-col items-center justify-center border-2 border-orange-500 hover:bg-blue-200 transition duration-300 ease-in-out"> {/* Increased height and centered content */}
              {/* Decorative number */}
              <div className="text-4xl font-bold text-orange-500 mb-4">{index + 1}</div>
              {/* Content for each section */}
              <h5 className="text-lg font-semibold text-center">Category</h5>
              <p className="text-base font-medium text-center">Content</p>
              <p className="text-base font-medium text-center">Balance: {index * 100} birr</p>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default CatCard;
